import React, { useState,useEffect } from "react"
import "react-widgets/styles.css"; 
import Combobox from "react-widgets/Combobox";
import axios from 'axios';


function SellingInputForm(props){

    const location = props.location
    const[municipality, setMunicipality] = useState('');
    const[neighborhood,setNeighborhood] = useState('');
    const[quadrature,setQuadrature]=useState('');
    const[roomCount,setRoomCount]=useState('');
    const[floor, setFloor]=useState('');
    const[heatingType,setHeatingType]=useState('');
    const[hasElevator, setHasElevator]=useState(false);
    const[registeredStatus, setRegisteredStatus]=useState(false);
    const[isLastFloor, setIsLastFloor]=useState(false);

    const[neighborhoodData, setNeighborhoodData]=useState([]);
    const roomCountEnum=['1.0', '1.5', '2.0', '2.5', '3.0', '3.5', '4.0', '4.5', '5.0'];
    const heatingTypeEnum=["Etažno", "Centralno", "Struja", "Gas", "TA peć", "Klima", "Podno", "Norveški radijatori", "Bez grejanja"] 

    const [price, setPrice] = useState(0);
    const [checkedElevator, setCheckedElevator] = useState(false);
    const [checkedRegistered, setCheckedRegistered] = useState(false);
    const [checkedLastFloor, setCheckedLastFloor] = useState(false);
    const[reloadFlag, setReloadFlag]=useState(false);

    const fetchData = async () => {
        let res = await axios.get('https://localhost:44338/api/Mapper/'+location);
        setReloadFlag(true);

        setMunicipality(res.data.location);
        setNeighborhoodData(res.data.neighborhoods);
        console.log(municipality);
        console.log(neighborhood);
    }

    function calculatePrice (e){
		e.preventDefault();
        axios.post('https://localhost:44338/api/PriceAnalyser/calculate',{
            municipality:municipality,
            neighborhood:neighborhood,
            quadrature:quadrature,
            roomCount:roomCount,
            floor:floor,
            isLastFloor:isLastFloor,
            heatingType:heatingType,
            hasElevator,hasElevator,
            registeredStatus:registeredStatus
        })
            .then((res)=>{
                console.log(res.data);
                setPrice(res.data);
            });
    }
    
    useEffect(() => {
        console.log("Loading")
        if(props.location){
            fetchData();
        }
    },[reloadFlag]);


   

    return(
        <div>
            <form>
                <h2>Unesite podatke o nekretnini</h2>
                <div>
                <label>Opština</label>
                    <input
                        type="text"
                        placeholder="Opština"
                        name="municipality"
                        disabled='true'
                        value={municipality}
                        className="inputField"
                        required = 'true'
                    ></input>
                </div>
                <div>
                <div>
                    <label>Naselje</label>
                    <Combobox
                        defaultValue=""
                        data={neighborhoodData}
                        placeholder="Izaberite naselje"
                        style={{ marginBottom: 20 }}
                        aria-required='true'
                        value={neighborhood} 
                        onChange={(value) => setNeighborhood(value)}
                        />
                </div>
                <div>
                    <label>Kvadratura</label>
                    <input
                        type="text"
                        placeholder="m2"
                        name="quadrature"
                        onInput={event=>setQuadrature(event.target.value)}
                        className="inputField"
                        required = 'true'
                        value={quadrature}
                    ></input>
                </div>
                <div>
                    <label>Broj soba</label>
                    <Combobox
                        defaultValue=""
                        data={roomCountEnum}
                        placeholder="Izaberite broj soba"
                        onChange={(value) => setRoomCount(value)}
                        style={{marginBottom:20}}
                        value={roomCount}
                        aria-required = 'true'
                    />
                </div>
                <div>
                    <label>Sprat</label>
                    <input
                        type="text"
                        name="floor"
                        onInput={(event)=>setFloor(event.target.value)}
                        className="inputField"
                        required = 'true'
                        value={floor}
                        // value={realEstateData.floor}
                    ></input>
                </div>
                <div className='checkbox-container'>
              <input id="checkHistoricalData" type="checkbox" className={checkedLastFloor ? "checkedHistoricalData":""} checked={checkedLastFloor} onChange={()=>{setIsLastFloor(!checkedLastFloor);}}></input>
              <label htmlFor='checkLastFloor'>Stan na poslednjem spratu</label>
              </div>
                <div>
                    <label>Grejanje</label>
                    <Combobox
                        defaultValue=""
                        data={heatingTypeEnum}
                        placeholder="Izaberite tip grejanja"
                        onChange={(value) =>setHeatingType(value)}
                        value={heatingType}
                        style={{marginBottom:20}}
                        aria-required = 'true'
                    />
                </div>
                <div className='checkbox-container'>
              <input id="checkHistoricalData" type="checkbox" className={checkedElevator ? "checkedHistoricalData":""} checked={checkedElevator} onChange={()=>{setHasElevator(!checkedElevator);}}></input>
              <label htmlFor='checkedElevator'>Zgrada sa liftom</label>
              </div>
              <div className='checkbox-container'>
              <input id="checkHistoricalData" type="checkbox" className={checkedRegistered ? "checkedHistoricalData":""} checked={checkedRegistered} onChange={()=>{setRegisteredStatus(!checkedRegistered);}}></input>
              <label htmlFor='checkedRegistered'>Registrovan stan</label>
              </div>
           
                <div>
                    <button onClick={calculatePrice} className="btnCalculate">
                        Izračunaj cenu
                    </button>
                </div>
                <div>
                    <h3>{price!==0 ? <>Procenjena cena nekretnine je {price}€.</> : null}</h3>
                </div>
                </div>
            </form>
        </div>
    )

}

export default SellingInputForm;
